/** @format */

import React from 'react';
import { SupplierList } from '../TextInfo';
import '../App.css';

const SupBlock = ( i ) => {
	i = i.i;
	const item = SupplierList[i];
	const background = {
		backgroundImage: `url(../images/suppliersLogo/${item.logo})`,
	};
	return (
		<span className='exp_block'>
			<div className='exp_location_img supplier' style={background}></div>
		</span>
	);
};

export default SupBlock;
